import React from 'react'

export default function Navbar() {

    const array = ['Manage Activity',  'Manage RO' , 'Student Activity']


  return (
    <>
    
    <div className="navbar">

        {
            <array className="filetr"></array>((ele)=>{
                <p>{ele}</p>
            })
        }

    </div>
    
    </>
  )
}
